g2:c.PROCEDURE.g2:a.TEXT:
ri-abort-test(node: class benchmark-node)

    err: class error;
    installation-dir, dir-sep, src-folder, path: text;
begin
    installation-dir = call grtl-get-installation-directory();
    dir-sep = call grtl-get-file-system-delimiter();
    src-folder = "[installation-dir][dir-sep]..[dir-sep]..[dir-sep]..[dir-sep]";
    //src-folder = "[installation-dir][dir-sep]src[dir-sep]";
    path = "[src-folder]gdanol[dir-sep]gda[dir-sep]kbs[dir-sep]gda.kb";
    post "[path]";
    call g2-merge-kb(path, true, false, false);
    call pass(node);
end on error(err)
    call fail(node, "[the error-description of err]");
end
